import classnames from 'classnames';

type ButtonProps = {
  height: string;
  width: string;
  color: string;
  text: string;
 }

function Button({ height, width, color, text}: ButtonProps) {
  return (
      <button className={classnames("h-{height} w-{width} flex items-center justify-center bg-{color} text-border rounded-full")}>  
          {text}   
    </button>
  )
}

export default Button
